    private static class Solution
    {
        public int lengthOfLongestSubstring(String s)
        {
            return -1;
        }

        public int lengthOfLongestSubstringNaive(String s)
        {
            List<Integer> lengths = new ArrayList<>(s.length());
            for (int i = 0; i < s.length(); i++)
            {
                Set<Character> characterSet = new HashSet<>();
                for (int j = i; j < s.length(); j++)
                {
                    if (!characterSet.add(s.charAt(j)))
                        break;
                }
                lengths.add(i, characterSet.size());
            }
            int res = lengths.size() > 0 ? Collections.max(lengths) : 0;
//            int res = lengths.stream().max(Integer::compareTo).orElse(lengths.size());
            return res;
        }
    }
